```cpp
#include <string>
#include <iostream>

std::string markdownToHtml(std::string& markdown) {
    std::string html;

    // Loop through each character in the markdown string
    for (char c : markdown) {
        // If the character is a hash symbol (#), convert it to an HTML header tag
        if (c == '#') {
            html += "<h1>";
        }
        // If the character is an asterisk (\*), convert it to an HTML bold tag
        else if (c == '*') {
            html += "<b>";
        }
        // If the character is an underscore (_), convert it to an HTML italic tag
        else if (c == '_') {
            html += "<i>";
        }
        // Append the character to the HTML string
        html += c;
        // If the character is a hash symbol (#), close the HTML header tag
        if (c == '#') {
            html += "</h1>";
        }
        // If the character is an asterisk (\*), close the HTML bold tag
        else if (c == '*') {
            html += "</b>";
        }
        // If the character is an underscore (_), close the HTML italic tag
        else if (c == '_') {
            html += "</i>";
        }
    }

    return html;
}
```
Note that this function only handles a limited subset of Markdown formatting, specifically headers, bold and italic text. You may need to add more logic to handle other Markdown formatting.

